// src/components/Footer.js
import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import logo from '../assets/images/footer logo.svg';
import '../assets/fonts/Quicksand-Regular.ttf';
import '../assets/fonts/Poppins-Regular.ttf';

const Footer = () => {
  const location = useLocation();

  const isActive = (path) => location.pathname === path;

  return (
    <footer>
      {/* Top Border Line */}
      <div style={styles.borderLine}></div>

      <section style={styles.top}>
        {/* Logo */}
        <Link to="/" style={styles.logoContainer}>
          <img src={logo} alt="Logo" style={styles.logo} />
        </Link>

        {/* Mission Section */}
        <div style={styles.missionColumn}>
          <h3 style={styles.columnTitle}>Our Mission</h3>
          <p style={styles.columnText}>
            Ummati Community is a community to empower women to be themselves, support one another, make friends, and have fun. We are a place of acceptance, inclusivity, and growth.
          </p>
        </div>

        {/* Stay Updated Section */}
        <div style={styles.stayUpdatedColumn}>
          <h3 style={styles.columnTitle}>Stay Updated</h3>
          <p style={styles.columnText}>
            Sign up with your email address to receive news and updates.
          </p>
          <div style={styles.signUpContainer}>
            <input type="email" placeholder="Enter your email" style={styles.emailInput} />
            <button style={styles.signUpButton}>Sign Up</button>
          </div>
        </div>

        {/* Site Links Section */}
        <div style={styles.linksAndLegalContainer}>
          <div style={styles.column}>
            <h3 style={styles.columnTitle}>Site Links</h3>
            <div style={styles.linksGrid}>
              <Link to="/events" style={{ ...styles.link, ...(isActive('/events') ? styles.activeLink : {}) }}>Events</Link>
              <Link to="/chapters" style={{ ...styles.link, ...(isActive('/chapters') ? styles.activeLink : {}) }}>Chapters</Link>
              <Link to="/faq" style={{ ...styles.link, ...(isActive('/faq') ? styles.activeLink : {}) }}>FAQs</Link>
              <Link to="/podcast" style={{ ...styles.link, ...(isActive('/podcast') ? styles.activeLink : {}) }}>Podcast</Link>
              <a href="/volunteer" style={styles.link}>Volunteer</a>
              <Link to="/about" style={{ ...styles.link, ...(isActive('/about') ? styles.activeLink : {}) }}>About</Link>
              <Link to="/membership" style={{ ...styles.link, ...(isActive('/membership') ? styles.activeLink : {}) }}>Membership</Link>
              <a href="/collaborate" style={styles.link}>Collaborate</a>
              <Link to="/contact" style={{ ...styles.link, ...(isActive('/contact') ? styles.activeLink : {}) }}>Contact</Link>
            </div>
          </div>

          {/* Legal Section */}
          <div style={styles.legalColumn}>
            <h3 style={styles.columnTitle}>Legal</h3>
            <div style={styles.legalLinks}>
              <Link to="/privacy" style={{ ...styles.link, ...(isActive('/privacy') ? styles.activeLink : {}) }}>Privacy</Link>
              <Link to="/terms" style={{ ...styles.link, ...(isActive('/terms') ? styles.activeLink : {}) }}>Terms</Link>
            </div>
          </div>
        </div>
      </section>

      {/* Bottom Border Line */}
      <div style={styles.borderLine}></div>

      <section style={styles.bottom}>
        <div style={styles.bottomText}>© 2024 Ummati Community | All Rights Reserved</div>
      </section>
    </footer>
  );
};

const styles = {
  borderLine: {
    width: '100%',
    height: '3px',
    backgroundColor: '#C4BAA2',
  },
  top: {
    display: 'flex',
    justifyContent: 'space-between',
    backgroundColor: '#F7F5EF',
    padding: '20px 40px',
    flexWrap: 'wrap',
    position: 'relative',
  },
  logoContainer: {
    flex: '1',
    maxWidth: '200px',
    height: '100%',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: '177px',
    height: '164px',
  },
  missionColumn: {
    flex: '2',
    maxWidth: '300px',
    marginLeft: '20px',
    marginBottom: '20px',
  },
  stayUpdatedColumn: {
    flex: '2',
    maxWidth: '300px',
    marginLeft: '20px',
    marginBottom: '20px',
  },
  linksAndLegalContainer: {
    flex: '1',
    maxWidth: '300px',
    marginLeft: 'auto', // Push to the far-right
    marginBottom: '20px',
  },
  column: {
    marginBottom: '20px',
  },
  legalColumn: {
    marginTop: '20px',
  },
  columnTitle: {
    color: '#5A4283',
    fontSize: '16px',
    fontFamily: 'Quicksand',
    fontWeight: '700',
    marginBottom: '10px',
    textAlign: 'left',
  },
  columnText: {
    color: 'black',
    fontSize: '12px',
    fontFamily: 'Poppins',
    fontWeight: '400',
    lineHeight: '1.5',
  },
  signUpContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
  },
  emailInput: {
    flex: '3',
    padding: '8px',
    borderRadius: '4px',
    border: '1px solid #ccc',
    fontSize: '14px',
    fontFamily: 'Poppins',
  },
  signUpButton: {
    flex: '1',
    padding: '10px',
    background: '#78B27B',
    borderRadius: '4px',
    color: 'white',
    fontSize: '14px',
    fontFamily: 'Quicksand',
    fontWeight: '700',
    cursor: 'pointer',
    textAlign: 'center',
    border: 'none',
  },
  linksGrid: {
    fontSize: 12,
    fontFamily: 'Poppins',
    fontWeight: '400',
    display: 'grid',
    gridTemplateColumns: 'repeat(2, 1fr)', // Updated to make it more readable
    gap: '5px',
  },
  legalLinks: {
    display: 'flex',
    flexDirection: 'column',
    gap: '5px',
  },
  link: {
    textDecoration: 'none',
    color: 'black',
  },
  activeLink: {
    fontWeight: '700',
  },
  bottom: {
    width: '100%',
    background: 'white',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '10px 0',
  },
  bottomText: {
    color: '#111111',
    fontSize: '12px',
    fontFamily: 'Poppins',
    textAlign: 'center',
  },
};

export default Footer;
